    // start function show
    public function show(Request $request){
        
        $shop_id = $request->shop_id;
        $rack_code = $request->rack_code;
        $starting_date = $request->starting_date;
        $ending_date = $request->ending_date;

        if(!empty($shop_id)){
            $shop_sql = " and shop_id='$shop_id'  ";
            
        }else{
            $shop_sql = "";
           
        }

        if(!empty($rack_code)){
            $rack_sql = " and rack_code='$rack_code' ";
        }else{
            $rack_sql = "";
        }
        
        if(!empty($starting_date) && !empty($ending_date)){
           

            $date_sql = " and return_date BETWEEN '$starting_date' and '$ending_date' ";
        }else{
            $date_sql = "";
        }

       

       

        $condition = $shop_sql . $rack_sql . $date_sql;

        // print "SELECT sh.name as shop_name,rp.shop_id,rp.rack_code, COUNT(rp.id) as socks_qt, rp.return_date  FROM `rack_products` rp 
        // left JOIN shops sh on rp.shop_id=sh.id rp WHERE rp.status = '5' $condition GROUP BY rp.shop_id,rp.rack_code, rp.return_date ";
        // die;

       $get_data = DB::select(DB::raw("SELECT sh.name as shop_name,rp.shop_id,rp.rack_code, COUNT(rp.id) as socks_qt, rp.return_date  FROM `rack_products` rp 
       left JOIN shops sh on rp.shop_id=sh.id  WHERE rp.status = '5' $condition GROUP BY rp.shop_id,rp.rack_code, rp.return_date "));

        $data = [
            "get_data"   => $get_data
        ];

        // return $data;

        return view('report.socks_return_voucher.show', $data);

    }
